import { BtnEffect } from "./BtnEffect";
import { Link } from "react-router-dom";

export const goToSignIn = () => {
  return (
    <BtnEffect>
      <Link to="/game">Start!</Link>
    </BtnEffect>
  );
};

export const goToSignUP = () => {
  return (
    <BtnEffect>
      <Link to="/signin" style={{ fontSize: "1.2rem" }}>
        회원가입/로그인
      </Link>
    </BtnEffect>
  );
};
